    INSERT INTO #tmgGlobalCodes
	SELECT *
    FROM tmgGlobalCodes
	
	DELETE FROM #temp0 WHERE @GENERATION_DATE NOT BETWEEN  StartDate AND EndDate

    INSERT INTO #temp
    SELECT
    @PARTNERID,
    @dt0,
    FieldName,
    Code,
    Left(MAX(Decode), 300),
    'Y',
    'N',
    'N'
    FROM #temp0
    GROUP BY FieldName, Code
	
	-- NEW

    INSERT INTO #INSERTED
    SELECT t.*
    FROM #temp t
    LEFT JOIN #tmgGlobalCodes G
	    ON t.PartnerID = G.PartnerID AND t.FieldName = G.FieldName AND t.Code = G.Code
    WHERE G.PartnerID IS NULL 
	
    INSERT INTO #tmgGlobalCodes
    OUTPUT 'tmgGlobalCodes',
	    'INS',
	    inserted.PartnerID,
	    inserted.EffDate,
	    inserted.FieldName,
	    inserted.Code,
        '',
	    inserted.decode,
	    inserted.StaticFlag,
	    inserted.DeletedFlag,
	    inserted.KeepDuringRollback
    INTO #SUMMARY
    SELECT PartnerID,
	    @dt0,
	    FieldName,
	    Code,
	    Decode,
	    'Y',
	    'N',
	    'N'
    FROM #INSERTED
	
	-- UPDATED
    INSERT INTO #UPDATED
    SELECT t.*
    FROM #temp t
    INNER JOIN #tmgGlobalCodes G
	    ON t.PartnerID = G.PartnerID AND t.FieldName = G.FieldName AND t.Code = G.Code
    WHERE t.DeCode <> G.DeCode
		

    UPDATE C
    SET C.DeCode = U.DeCode
    OUTPUT 'tmgGlobalCodes',
    'UPD',
    inserted.PartnerID,
    inserted.EffDate,
    inserted.FieldName,
    inserted.Code,
    deleted.decode,
    inserted.decode,
    inserted.StaticFlag,
    inserted.DeletedFlag,
    inserted.KeepDuringRollback
    INTO #SUMMARY
    FROM #tmgGlobalCodes C
    INNER JOIN #UPDATED U
    ON C.PartnerID = U.PartnerID AND C.FieldName = U.FieldName AND C.Code = U.Code

	
	-- DELETED
	
   INSERT INTO #DELETED
    SELECT G.*
    FROM #tmgGlobalCodes G
    LEFT JOIN #temp t
    ON t.PartnerID = G.PartnerID AND t.FieldName = G.FieldName AND t.Code = G.Code
    WHERE t.PartnerID IS NULL AND G.FieldName IN (
    SELECT DISTINCT FieldName
    FROM #temp0 t2
    ) AND (G.DeCode NOT LIKE '* REMOVED *%' AND G.DeCode NOT LIKE '*Removed*%')

    UPDATE C
    SET C.DeCode = '* REMOVED * ' + C.DeCode
    OUTPUT 'tmgGlobalCodes',
    'DEL',
    deleted.PartnerID,
    deleted.EffDate,
    deleted.FieldName,
    deleted.Code,
    deleted.decode,
    inserted.decode,
    deleted.StaticFlag,
    deleted.DeletedFlag,
    deleted.KeepDuringRollback
    INTO #SUMMARY
    FROM #tmgGlobalCodes C
    INNER JOIN #DELETED U
    ON C.PartnerID = U.PartnerID AND C.FieldName = U.FieldName AND C.Code = U.Code
	
	-- APPLY CHANGES
	
    INSERT INTO tmgGlobalCodes
    SELECT PartnerID,
    @dt0,
    FieldName,
    Code,
    MAX(Decode),
    'Y',
    'N',
    'N'
    FROM #tmgGlobalCodes I
    WHERE NOT EXISTS (
    SELECT TOP 1 PartnerID
    FROM tmgGlobalCodes
    WHERE PartnerID = I.PartnerID AND FieldName = I.FieldName AND Code = I.Code
    )
    GROUP BY PartnerID, FieldName, Code

    UPDATE C
    SET C.Decode = LEFT(U.Decode, 300)
    FROM tmgGlobalCodes C
    INNER JOIN #tmgGlobalCodes U
    ON C.PartnerID = U.PartnerID AND C.FieldName = U.FieldName AND C.Code = U.Code

